import React from "react";
import { useParams } from 'react-router-dom';

import exit from '../pics/exit.svg';

function Me() {
    let { id } = useParams();
    const [user, setUser] = useState();
    const [page, setPage] = useState('');
    useEffect(() => {
        axios.get(`http://localhost:3001/users?id=${id}`).then((res) => {
            setUser(res.data)
        });
    }, []);
    return (
        <div className="me">
            <MenuNav />
            <div className="body">
                <aside>
                    <ul>
                        <li onClick={setPage('')}><a>Профиль</a></li>
                        <li onClick={setPage('favorites')}><a>Избранное</a></li>
                        <li onClick={setPage('pets')}><a>Питомцы</a></li>
                        <li onClick={setPage('orders')}><a>Заказы</a></li>
                    </ul>
                    <div className="exit">
                        <button>
                            <img src={exit} />
                            Выйти
                        </button>
                    </div>
                </aside>
                <div className="main">
                    {page === ''
                        ?
                        <>
                            <h4>Профиль</h4>
                            <div className="inf">
                                <div className="general">

                                </div>
                                <div className="additional">

                                </div>
                            </div>
                        </>
                        : ''
                    }
                </div>
            </div>
        </div>
    );
}

export default Me;
